import Home from '../components/views/Home';
import Error from '../components/views/Error';
import Profile from "../components/views/Profile";
export default [
    {
        path: "/:id", 
        exact: true,
        page: Profile
    },
    {
        path: "/", 
        exact: true,
        page: Home
    },
    {
        path: "*",
        page: Error
    }
];
